import React from "react";
import { NavigationContainer } from "@react-navigation/native";
import TabNav from "./TabNav";

const MainAuthed = () => {
  return (
    <NavigationContainer>
      <TabNav />
    </NavigationContainer>
  );
};

export default MainAuthed;
